class bcolors:
    HEADER = '\033[95m'
    OKBLUE = '\033[94m'
    OKGREEN = '\033[92m'
    WARNING = '\033[93m'
    FAIL = '\033[91m'
    ENDC = '\033[0m'


def custom_logger(log_level=logging.DEBUG):
    """
    This method use to customize logging
    """
    # Gets the name of the class / method from where this method is called
    logger_name = inspect.stack()[2][1]
    logger = logging.getLogger(logger_name)
    if logger.hasHandlers():
        # Logger is already configured, remove all handlers
        logger.handlers = []

    # By default, log all messages
    logger.setLevel(logging.DEBUG)

    log_file = datetime.now().strftime("run_%b_%d_%Y.log")

    file_handler = logging.FileHandler(filename=os.path.join('log', log_file))

    file_handler.setLevel(log_level)

    formatter = logging.Formatter('%(asctime)s - %(name)-64s - %(levelname)-8s: %(message)s',
                                  datefmt='%b%d %H:%M:%S')
    file_handler.setFormatter(formatter)
    logger.addHandler(file_handler)

    return logger


def INFO(msg):
    """Logs an info message.

    Args:
      msg (str): The message to be logged.

    Returns:
      None
    """
    log = custom_logger(logging.INFO)
    log.info(msg)
    print(bcolors.OKGREEN + "  [INFO] " + str(msg) + bcolors.ENDC)


def ERROR(msg):
    """Logs an debug message.

    Args:
      msg (str): The message to be logged.

    Returns:
      None
    """
    log = custom_logger(logging.ERROR)
    log.error(msg)
    print(bcolors.FAIL + "  [ERROR] " + msg + bcolors.ENDC)


class ws():
    def __init__(self, url):
        self.url = url
        self.timeout = 160
        self.ws_conn = create_connection(self.url, self.timeout)

    def createConnection(self):
        if not self.ws_conn:
            ERROR("FAILED to establish ws connection: " + self.url)
            ERROR("ERROR: " + str(self.ws_conn))
            return False
        INFO("SUCCEED to establish ws connection: " + self.url)
        return True

    def subcribePendingTransaction(self, txid):
        data = {"request": {"jsonrpc": "1.0", "method": "subcribependingtransaction", "params": [txid], "id": 1},
                "subcription": "11", "type": 0, }
        self.ws_conn.send(json.dumps(data))
        # INFO("-" * 16)
        INFO("Sent subcribependingtransaction: " + txid)
        INFO("Receiving...")
        result = json.loads(self.ws_conn.recv())

        INFO("Block No.: " + str(result['Result']['Result']['BlockHeight']))
        INFO("Fee: " + str(result['Result']['Result']['Fee']))

        return True

    def closeConnection(self):
        self.ws_conn.close()


