    def stopautostake(self, url, staker_privatekey, reward_receiver_paymentaddress, validator_key):
        headers = {'Content-Type': 'application/json'}
        data = {"jsonrpc": "1.0", "method": "createandsendstopautostakingtransaction",
                "params": [staker_privatekey, {
                    "12RxahVABnAVCGP3LGwCn8jkQxgw7z1x14wztHzn455TTVpi1wBq9YGwkRMQg3J4e657AbAnCvYCJSdA9czBUNuCKwGSRQt55Xwz8WA": 0},
                           -1, 0,
                           {"StopAutoStakingType": 127,
                            "CandidatePaymentAddress": reward_receiver_paymentaddress,
                            "PrivateSeed": validator_key
                            }], "id": 1}
        response = requests.post(url, data=json.dumps(data), headers=headers)
        aa = json.loads(response.text)

        if aa['Error'] == None:
            INFO(aa['Result']['TxID'])
            return aa['Result']['TxID']
        else:
            ERROR(aa['Error']['StackTrace'][:128])
            return aa['Error']['Message']

    def unstake(self, url, staker_privatekey, reward_receiver_paymentaddress, validator_key):
        headers = {'Content-Type': 'application/json'}
        data = {"jsonrpc": "1.0", "method": "createunstaketransaction",
                "params": [staker_privatekey, {
                    "12RxahVABnAVCGP3LGwCn8jkQxgw7z1x14wztHzn455TTVpi1wBq9YGwkRMQg3J4e657AbAnCvYCJSdA9czBUNuCKwGSRQt55Xwz8WA": 0},
                           -1, 0,
                           {"UnStakingType": 210,
                            "CandidatePaymentAddress": reward_receiver_paymentaddress,
                            "PrivateSeed": validator_key
                            }], "id": 1}
        response = requests.post(url, data=json.dumps(data), headers=headers)
